import React from 'react';
import '../styles/content.css'

export default function Content() {

    return (
    <div className="content">
       <h1>Zugangsdichte</h1>
       <p className="contentText">At vero eos et accusam et justo duo dolores et ea rebum. Stet clita kasd gubergren, no sea takimata sanctus est Lorem ipsum dolor sit amet. </p>
    </div>
    );
}
